import Tile from './components/tile.js'

const Grid = ({ grid, functions }) => {

  return (
    <div className="board">
      {grid.map( tile =>
        <Tile 
          key={tile.id}
          tile={tile} 
          functions={functions}
        />
      )}
    </div>
  )
}

export default Grid
